INSERT INTO `cases` (`id`, `case_number`, `title`, `description`, `client_id`, `status`, `created_at`, `updated_at`) VALUES
(1, '252624', 'A Case Study on Plagiarism in Professional Writing', 'This case study investigates the often-overlooked issue of plagiarism in professional and academic case report writing. Through detailed examples and analysis, it illustrates how subtle forms of content duplication such as improper paraphrasing or self-plagiarism can undermine credibility and lead to serious repercussions. The study also outlines practical strategies for writers to maintain originality, including ethical research habits, citation discipline, and the use of modern plagiarism detection tools. It serves as a cautionary yet instructive resource for students, educators, and professionals striving for integrity in their written work.', 2, 'Closed', '2025-06-23 14:59:23', '2025-06-24 04:45:00');
